import React from 'react'

const AdminAcceptedKyc = () => {
  return (
    <div>
    {kycRequest
      ? kycRequest?.map((el) => {
          return (
            <div className="allkyc-box">
              <div>
                <p>{el?.owner?.name}</p>
                <p style={{ marginTop: "-20px" }}>
                  {" "}
                  <strong>{el?.owner?.email}</strong>
                </p>
              </div>

              <button
                onClick={() => {
                  setEd(true);
                  setAathar(el?.aatharImage);
                  setAatharSelfie(el?.aatharSelfie);
                  setPan(el?.panImage);
                  setGst(el?.gstNumber);
                }}
              >
                <VisibilityIcon />
              </button>
            </div>
          );
        })
      : ""}

    {ed ? (
      <div className="admin-kyc-show">
        <div>
          <img src={aathar} alt="" />
          <img src={aatharSelfie} alt="" />
          <img src={pan} alt="" />
          <h2 style={{ marginTop: "10px", color: "white" }} className="mt-5">
            {" "}
            GST: <strong>{gst}</strong>{" "}
          </h2>
        </div>

        <div
          style={{ display: "flex", width: "400px", flexDirection: "row" }}
          className="bfsa"
        >
          <button style={{ backgroundColor: "#3CCF4E" }}>Accept</button>
          <button style={{ backgroundColor: "#FF5454" }} className="mx-3">
            Reject
          </button>
        </div>
      </div>
    ) : (
      ""
    )}
  </div>
  )
}

export default AdminAcceptedKyc
